// A component in React is a function!!!

function ExpenseItem() {
    return (
        <div>
            <div>Date</div>
            <div>
                <h2>Car Insurance</h2>
                <div>$293.4</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
